window.cwa={page:{},dialog:{}};cwa.setErrorMessages=function(n){const t='<i class="bi-exclamation-circle"><\/i>';$(".cwa-small").html("&nbsp;");$(n).each(function(){const n="#"+this.key;$(n).html(t)})};cwa.clearForm=function(n){var t=document.querySelector(n).elements,u,r;for(i=0;i<t.length;i++){u=t[i].type.toLowerCase();switch(u){case"text":case"email":case"password":case"textarea":t[i].value="";break;case"radio":case"checkbox":t[i].checked&&(t[i].checked=!1);break;case"select-one":case"select-multi":t[i].selectedIndex=0;break;case"file":r=$(t[i]);r.replaceWith(r.val("").clone(!0))}}};cwa.settext=function(n,t){$(n).text(t)};cwa.copy=function(n){return $.extend({},n)};cwa.bstooltips=function(){const n=document.querySelectorAll('[data-bs-toggle="tooltip"]'),t=[...n].map(n=>new bootstrap.Tooltip(n))};